import { title } from '@connnect/shared/utils/title'
import { Alert, AlertDescription, AlertTitle } from '@connnect/ui/components/alert'
import { Button } from '@connnect/ui/components/button'
import { Dialog, DialogContent, DialogHeader, DialogTitle, DialogTrigger } from '@connnect/ui/components/dialog'
import { RiAlarmWarningLine, RiDownloadLine } from '@remixicon/react'
import { createFileRoute, Outlet } from '@tanstack/react-router'
import { databaseQuery, prefetchDatabaseCore, useDatabase } from '~/entities/database'
import { queryClient } from '~/main'
import { DatabaseSidebar } from './-components/database-sidebar'
import { PasswordForm } from './-components/password-form'

export const Route = createFileRoute('/(protected)/_protected/database/$id')({
  component: DatabasePage,
  beforeLoad: async ({ params }) => {
    const database = await queryClient.ensureQueryData(databaseQuery(params.id))

    prefetchDatabaseCore(database)

    return { database }
  },
  loader: ({ context }) => ({ database: context.database }),
  head: ({ loaderData }) => ({
    meta: loaderData
      ? [
          {
            title: title(loaderData.database.name),
          },
        ]
      : [],
  }),
})

function UpdateDialog() {
  return (
    <Dialog>
      <DialogTrigger>
        <span className="opacity-50 hover:opacity-100 duration-300 cursor-pointer">
          <strong>Rebranding!</strong>
          {' '}
          Click here to read more and continue receiving updates.
        </span>
      </DialogTrigger>
      <DialogContent>
        <DialogHeader>
          <DialogTitle>
            Connnect is renaming
          </DialogTitle>
          <div className="space-y-4 text-neutral-700 dark:text-neutral-300">
            <p>
              When we first launched, we quickly chose the name
              {' '}
              <strong>Connnect</strong>
              {' '}
              to create our proof of concept and validate the need for this product.
            </p>

            <p>
              We're thrilled to share that in just 1.5 months, nearly
              {' '}
              <strong>150 people worldwide</strong>
              {' '}
              are already using our app, and our community continues to grow every day.
            </p>

            <img
              src="data:image/png;base64,"
            />

            <p>
              Based on your feedback and our own experience, we've made an important decision:
              {' '}
              <span className="block text-lg mt-6 text-center">
                We're rebranding to
                {' '}
                <strong>Conar</strong>
                {' '}
                🎉
              </span>
              <span className="text-center w-full block text-muted-foreground">
                New name, new logo, new design.
              </span>
            </p>

            <Alert className="mt-8">
              <RiAlarmWarningLine />
              <AlertTitle>Auto-updates are disabled</AlertTitle>
              <AlertDescription>
                Due to technical limitations after renaming, you'll need to download the renamed version to continue receiving updates.
                <br />
                <br />
                We apologize for any inconvenience this may cause 😢
              </AlertDescription>
            </Alert>
            <p>
              Just press the button below to download the renamed version and continue receiving updates.
            </p>
            <Button asChild className="mt-4" size="lg">
              <a href="https://conar.app/download" target="_blank" rel="noreferrer noopener">
                Download Conar
                <RiDownloadLine />
              </a>
            </Button>
            <p className="text-muted-foreground text-sm">
              P.S. We've already added the tabs feature in Conar! 🎉
            </p>
          </div>
        </DialogHeader>
      </DialogContent>
    </Dialog>
  )
}

function DatabasePage() {
  const { id } = Route.useParams()
  const { data: database } = useDatabase(id)

  if (database.isPasswordExists && !database.isPasswordPopulated) {
    return <PasswordForm database={database} />
  }

  return (
    <div className="flex bg-gray-100 dark:bg-neutral-950/60">
      <DatabaseSidebar className="w-16" />
      <div className="h-[calc(100vh-theme(spacing.8))] w-[calc(100%-theme(spacing.16)-theme(spacing.2))] m-2 ml-0">
        <Outlet />
        <div className="h-4 translate-y-1 flex items-center justify-center text-xs">
          <UpdateDialog />
        </div>
      </div>
    </div>
  )
}
